const DUMMY_EVENTS = [
  {
    id: 'e1',
    title: 'some event',
  },
  {
    id: 'e2',
    title: 'Another event',
  },
];

function EventsPage() {
  return (
    <>
      <h1>EventsPage</h1>
      <ul>
        {DUMMY_EVENTS.map((ev)=> <li key={ev.id}>{ev.title}</li>)}
      </ul>
    </>
  );
}

export default EventsPage;
